import React, { Component } from "react";
import Table from "./components/Table";

class App extends Component {
    constructor(){
        super()
        this.state = {
            data : []
            // ID: 1,
            // Photo: "",
            // FirstName: "",
            // LastName: "",
            // height: "",
            // Delete: ""
        }
    }
    componentDidMount(){
        fetch('http://localhost:5000/GET',{
            'methods':'GET',
            headers : {
              'Content-Type':'application/json'
            }
          })
          .then(response => response.json())
          .then(data => this.setState({Photo: data.thumbnail}))
          .catch(error => console.log(error))

        }


    render() {
        return (
            <table class="table">
            <tr > 
                <th>ID</th>
                <th>Photo</th>
                <th>FirstName</th>
                <th>LastName</th>
                <th>height</th>
                <th>Delete</th>
            </tr>
            <Table ID={this.state.ID} FirstName={this.state.FirstName} LastName={this.state.LastName} height={this.state.height} thumbnail={this.state.Photo}/>
            </table>
        )
    }

}


export default App
